import { ComponentType } from "react";

import LiveVideo from "../Containers/LiveVideo";
import Home from "../Containers/Home";
import AboutUs from "../Containers/AboutUs";

interface route {
    path: string;
    name: string;
    component: ComponentType;
}

const routes: route[] = [
    {
        path: '/',
        name: 'Home',
        component: Home
    },
    {
        path: '/over-ons',
        name: 'over-ons',
        component: AboutUs
    },
    {
        path: '/livevideo',
        name: 'Live video',
        component: LiveVideo
    }

];

export default routes;
